// Importar crypto
const crypto = require('crypto');

// 1. Obtenemos el texto JSON que viene dentro de content.parts[0].text
const rawText = items?.[0]?.json?.content?.parts?.[0]?.text 
  || $input?.first()?.json?.content?.parts?.[0]?.text
  || '[]';

// 2. Parseamos el string a objeto
let data;
try {
  data = JSON.parse(rawText);
} catch (err) {
  console.error("Error al parsear JSON:", err);
  data = [];
}

// 2.1 Normalizar: si no es array, lo convertimos en uno
if (!Array.isArray(data)) {
  data = [data];
}

// 3. Preparamos la salida "aplanada"
const salida = [];

for (const seccion of data) { 
  if (!seccion.productos) continue; 
  for (const producto of seccion.productos) {
    salida.push({
      json: {
        categoria: seccion.categoria,
        nombre: producto.nombre,
        precio: producto.precio === "No visible" ? null : producto.precio,
        presentacion: producto.presentacion,
        observaciones: producto.observaciones,
        tienda: $('When Executed by Another Workflow').first().json.tienda,
        userid: $('When Executed by Another Workflow').first().json.userId,
        imagenAnalizada: $('When Executed by Another Workflow').first().json.url,
        id_producto: crypto.randomUUID()
      }
    });
  }
}

return salida;

